Parses.Sparql:
#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x 
WHERE {
	FILTER (?x != ns:m.06bnz)
	{ 
	  ns:m.06bnz ns:location.statistical_region.places_exported_to ?y .
	  ?y ns:location.imports_and_exports.exported_to ?x . 
	}
	UNION
	{
	  ns:m.06bnz ns:location.statistical_region.places_imported_from ?y .
	  ?y ns:location.imports_and_exports.imported_from ?x . 
	}
}
